  false,\n\t\"url\": null,\n\t\"notes\": \"The gravity station data (5,363 records)
  were compiled by the U. S. Geological Survey. This data base was received on February
  23, 1993. Principal gravity parameters include observed gravity and Free-air anomalies.
  The observed gravity values are believed referenced to the International Gravity
  Standardization Net 1971 (IGSN 71). It is also believed the gravity anomaly computation
  uses the Geodetic Reference System 1967 (GRS 67) theoretical gravity formula.\",\n\t\"owner_org\":
